webpackJsonp([0xbfa47205bc19],{2823:function(e,n){e.exports={pathContext:{docHtml:'<h1>locate-path <a href="https://travis-ci.org/sindresorhus/locate-path"><img src="https://travis-ci.org/sindresorhus/locate-path.svg?branch=master" alt="Build Status"></a></h1>\n<blockquote>\n<p>Get the first path that exists on disk of multiple paths</p>\n</blockquote>\n<h2>Install</h2>\n<pre><code>$ npm install --save locate-path\n</code></pre>\n<h2>Usage</h2>\n<p>Here we find the first file that exists on disk, in array order.</p>\n<pre><code class="language-js">const locatePath = require(\'locate-path\');\n\nconst files = [\n    \'unicorn.png\',\n    \'rainbow.png\', // only this one actually exists on disk\n    \'pony.png\'\n];\n\nlocatePath(files).then(foundPath => {\n    console.log(foundPath);\n    //=> \'rainbow\'\n});\n</code></pre>\n<h2>API</h2>\n<h3>locatePath(input, [options])</h3>\n<p>Returns a <code>Promise</code> for the first path that exists or <code>undefined</code> if none exists.</p>\n<h4>input</h4>\n<p>Type: <code>Iterable&#x3C;string></code></p>\n<p>Paths to check.</p>\n<h4>options</h4>\n<p>Type: <code>Object</code></p>\n<h5>concurrency</h5>\n<p>Type: <code>number</code><br>\nDefault: <code>Infinity</code><br>\nMinimum: <code>1</code></p>\n<p>Number of concurrently pending promises.</p>\n<h5>preserveOrder</h5>\n<p>Type: <code>boolean</code><br>\nDefault: <code>true</code></p>\n<p>Preserve <code>input</code> order when searching.</p>\n<p>Disable this to improve performance if you don\'t care about the order.</p>\n<h5>cwd</h5>\n<p>Type: <code>string</code><br>\nDefault: <code>process.cwd()</code></p>\n<p>Current working directory.</p>\n<h3>locatePath.sync(input, [options])</h3>\n<p>Returns the first path that exists or <code>undefined</code> if none exists.</p>\n<h4>input</h4>\n<p>Type: <code>Iterable&#x3C;string></code></p>\n<p>Paths to check.</p>\n<h4>options</h4>\n<p>Type: <code>Object</code></p>\n<h5>cwd</h5>\n<p>Same as above.</p>\n<h2>Related</h2>\n<ul>\n<li><a href="https://github.com/sindresorhus/path-exists">path-exists</a> - Check if a path exists</li>\n</ul>\n<h2>License</h2>\n<p>MIT Â© <a href="https://sindresorhus.com">Sindre Sorhus</a></p>',docPath:"argo-ci/node_modules/locate-path/readme",proj:"argo-ci"}}}});
